# Callback for forecast
@app.callback([Output("forecast-content", "children")],
              [Input("submit-forc", "n_clicks")],
              [State("Forecast_Input", "value"),
               State("stock-symbol", "value")])
def forecast(n, days_n, val):
    if n is None or n == 0:
        return [""]
    if val is None:
        raise PreventUpdate




    # Fetch stock data or load it from wherever you have it
    # Example using yfinance to fetch the last 100 days of data
    stock_data = yf.download(val, period="100d")
    
    # Assuming 'Close' prices are used for forecasting
    data_for_forecasting = stock_data['Close'].values.reshape(-1, 1)

    # Use the forecasting functions from model.py
    lstm_model, scaler = train_lstm_model(data_for_forecasting, look_back=20, epochs=100)
    
    # Predict the close prices for the next 'days_n' days
    predicted_prices = []
    for _ in range(int(days_n)):
        predicted_price = predict_close_price(lstm_model, scaler, data_for_forecasting, look_back=20)
        predicted_prices.append(predicted_price)
        data_for_forecasting = np.append(data_for_forecasting, predicted_price).reshape(-1, 1)

    # Create a Plotly figure to display the predicted close prices with dates on the x-axis
    forecast_dates = pd.date_range(start=stock_data.index[-1] + pd.Timedelta(days=1), periods=int(days_n), freq='B')
    fig = px.line(x=forecast_dates,
                  y=predicted_prices, labels={'x': 'Date', 'y': 'Predicted Close Price'},
                  title=f'Predicted Close Prices for the Next {days_n} Days')

    result_figure = dcc.Graph(figure=fig)
    
    return result_figure,
 
